import React from "react";
import PropTypes from "prop-types";
import { Modal } from "react-native";
import { WebView } from 'react-native-webview';
import Header from "./Header";

const Webview = ({ webviewOpen, setWebviewOpen, url }) => (
  <Modal
    animationType="slide"
    visible={webviewOpen}
    onRequestClose={() => { }}
    statusBarTranslucent
  >
    <Header close transparent closeAction={() => setWebviewOpen(false)} />

    <WebView
      originWhitelist={['*']}
      javaScriptEnabled
      domStorageEnabled
      source={{
        uri: url,
      }}
    />
  </Modal>
);

Webview.propTypes = {
  webviewOpen: PropTypes.bool.isRequired,
  setWebviewOpen: PropTypes.func.isRequired,
  url: PropTypes.string.isRequired,
};

export default Webview;
